import React from 'react';
import {Switch, Route} from 'react-router-dom';
import Toolbar from './components/HOMEPAGE/res-nav/res-nav.component';
import SideDrawer from './components/HOMEPAGE/sideDrawer/sideDrawer.component';
import BackDrop from './components/HOMEPAGE/backdrop/backdrop.component';
import HomePage from './pages/homepage/homepage.component';

import './App.css';

function App() {
  return (
    <div className="App">
      <Toolbar />
      <SideDrawer />
      <BackDrop />
      <Switch>
        <Route exact path="/" component={HomePage} />
      </Switch>

    </div>
  );
}

export default App;
